import React from "react";
import { ReactComponent as HeaderLogo } from '../SVG/headerLogo.svg';
import { ReactComponent as HeaderBasket } from '../SVG/headerBasket.svg';
import {Link} from "react-router-dom";
import styles from "./Header.module.css"
import Categories from "./Categories";
import Button from "./Button";


class Header extends React.Component {
    // constructor(props) {
    //     super(props);
    // }


    render() {
        console.log(this.props.productCard )
        return(
            <div className={styles.container}>
                <Link to="/">
                    <div className={styles.navigation} >
                        {/*<div className={styles.navigation} onClick={() => this.props.onClick()}>*/}
                        <Categories
                            onClick={(index)=> {this.props.onSelectCategories(index)}}
                            productCards={this.props.productCard}/>
                            {/*</div>*/}
                    </div>
                </Link>

                <div className={styles.logo}>
                    <HeaderLogo/>
                </div>
                <Link to="/cart">
                    {/*<Button />*/}
                    <Button outline onClick={this.props.onClick}/>
                    {/*<div className={styles.actions}>*/}
                    {/*    <div className={styles.actionsItem}>$</div>*/}
                    {/*    <div>< HeaderBasket/></div>*/}
                    {/*</div>*/}
                </Link>
            </div>
        )
    }
}

export default Header;
